import React, { useState } from 'react';
import './App.css';
import electronicsIcon from './electronics.png';
import appliancesIcon from './appliances.png';
import mechanicsIcon from './mech.png';

function App() {
  const [page, setPage] = useState('community'); // Defaulting to community for focus
  const [isModalOpen, setModalOpen] = useState(false); // Control modal visibility

  const handleNavigate = (targetPage) => {
    setPage(targetPage);
  };

  const handleModalToggle = () => {
    setModalOpen(!isModalOpen);
  };

  const handleFormSubmit = (e) => {
    e.preventDefault();
    setModalOpen(false); // Close the modal after form submission
  };

  return (
    <div className="app">
      <header className="header">
        <nav className="navbar">
          <ul>
            <li><button className="nav-link" onClick={() => handleNavigate('home')}>Home</button></li>
            <li><button className="nav-link" onClick={() => handleNavigate('events')}>Events</button></li>
            <li><button className="nav-link" onClick={() => handleNavigate('community')}>Resources</button></li>
            <li><button className="nav-link" onClick={() => handleNavigate('signup')}>Sign-Up</button></li>
          </ul>
        </nav>
      </header>

      {page === 'community' && (
        <main className="community-content">
          <h1>Find a Community Repair Forum</h1>
          <div className="community-categories">
            <div className="community-item">
              <img src={electronicsIcon} alt="Electronics" />
              <p>Electronics</p>
            </div>
            <div className="community-item">
              <img src={appliancesIcon} alt="Home Appliances" />
              <p>Home Appliances</p>
            </div>
            <div className="community-item">
              <img src={mechanicsIcon} alt="Mechanics" />
              <p>Mechanics</p>
            </div>
          </div>
          <div className="no-posts">
            <p>No Posts Yet</p>
          </div>
          <button className="add-button" onClick={handleModalToggle}>+</button>
          {isModalOpen && (
            <div className="modal">
              <div className="modal-content">
                <h2>Create a Post</h2>
                <form onSubmit={handleFormSubmit}>
                  <textarea
                    placeholder="Connect with your community here..."
                    className="form-textarea"
                    required
                  ></textarea>
                  <div className="form-actions">
                    <input type="file" className="form-file" />
                    <button type="submit" className="button">Submit</button>
                  </div>
                </form>
                <button className="button close-button" onClick={handleModalToggle}>Close</button>
              </div>
            </div>
          )}
        </main>
      )}
    </div>
  );
}

export default App;
